in_source: |-
  # Тестируем 22 выражения, печатаем то, что они возвращают
  (print_int (defvar a 10))
  (print_char 10)

  (print_int (setq a 33))
  (print_char 10)

  (print_int (+ a 54 3 6 -999))
  (print_char 10)

  (print_int (- 78 a 98))
  (print_char 10)

  (print_int (*))
  (print_char 10)

  (print_int (/ 45 2))
  (print_char 10)

  (print_int (mod 10 3))
  (print_char 10)

  (print_int (= 21 21))
  (print_char 10)

  (print_int (> 23 43))
  (print_char 10)

  (print_int (< 234 234))
  (print_char 10)

  (print_int (if 1 3 6))
  (print_char 10)

  (print_int (and 12 23 88))
  (print_char 10)

  (print_int (or 234 34 23 23 22))
  (print_char 10)

  (print_int (not 0))
  (print_char 10)

  (print_int (print_str "hello word"))
  (print_char 10)

  (print_int (print_char 37))
  (print_char 10)

  (print_int (print_int 98765))
  (print_char 10)

  (print_int (read_char))
  (print_char 10)

  (print_int (read_str))
  (print_char 10)

  (print_int (loop_while 0 12))
  (print_char 10)

  (print_int "HELLO WORLD")
  (print_char 10)

  (print_int 1234)

